import Button from "../components/Button";
import styled from "styled-components";

function StyleGuide() {
    const printSomething = () => console.log("Something");

    const mb = {
        marginBottom: '20px'
    }

    const p = { padding: '10px' }

    return (
        <div style={{ maxWidth: '1200px', margin: 'auto', padding: '60px 20px' }}>
            <h1>Shilly Styleguide</h1>

            <Section>
                <h2 style={mb}>Big Buttons</h2>
                {/* Adding size='big' is optional. Buttons are big by default */}
                <Button variant='primary' onClick={printSomething}>Primary</Button>
                <Button variant='secondary' onClick={printSomething} size='big'>Secondary</Button>
                <Button variant='tertiary' onClick={printSomething} size='big'>Tertiary</Button>
                <Button variant='destructive'>Destructive</Button>
                <Button variant='destructive' disabled>Disabled Destructive</Button>
            </Section>


        </div>
    );
}

const Section = styled.section`
    margin: 60px 0;
`;

const Flexbox = styled.div`
    display: flex;
    align-items: center;

`;


export default StyleGuide;
